import React, { Component } from 'react';

class FaleMais extends Component {
  render() {
    console.log(this.props);
    return (
      <li className="FaleMais">
        {this.props.planos.title} - {this.props.planos.category}
      </li>
    );
  }
}

export default FaleMais;
